/// <summary>
/// DPM_* https://github.com/pdf-association/pdf-issues/issues/86
/// </summary>
internal partial class APM_DPM_CatchAll : APM_DPM_CatchAll_Base
{
}


internal partial class APM_DPM_CatchAll_Base : ISpecification<PdfDictionary>
{
    public static string Name { get; } = "DPM_*";
    public static bool RuleGroup() { return false; }
    public static bool MatchesType(PdfValidator ctx, PdfDictionary obj) { return false; } // not used for children
    public static bool AppliesTo(decimal version, List<string> extensions) { return false; }
    public static void Validate(PdfValidator ctx, CallStack stack, PdfDictionary obj, IPdfObject? parent)
    {
        
        foreach (var key in obj.Keys)
        {
            if (AllVals.Contains(key)) { continue; }
            
            
            var (utval, wasIR) = ctx.GetOptional<APM_DPM_CatchAll>(obj, key, IndirectRequirement.Either);
            if (utval == null) { return; }
            switch (utval.Type) 
            {
                case PdfObjectType.ArrayObj:
                    {
                        var val =  (PdfArray)utval;
                        // no indirect obj reqs
                        // no special cases
                        // no value restrictions
                        ctx.Run<APM__UniversalArray, PdfArray>(stack, val, obj);
                        return;
                    }
                case PdfObjectType.BooleanObj:
                    {
                        var val =  (PdfBoolean)utval;
                        // no indirect obj reqs
                        // no special cases
                        // no value restrictions
                        // no linked objects
                        return;
                    }
                
                // TODO MC array;boolean;date;dictionary;integer;name;number;string-text
                case PdfObjectType.DictionaryObj:
                    {
                        var val =  (PdfDictionary)utval;
                        // no indirect obj reqs
                        // no special cases
                        // no value restrictions
                        ctx.Run<APM__UniversalDictionary, PdfDictionary>(stack, val, obj);
                        return;
                    }
                
                // TODO MC array;boolean;date;dictionary;integer;name;number;string-text
                case PdfObjectType.NameObj:
                    {
                        var val =  (PdfName)utval;
                        // no indirect obj reqs
                        // no special cases
                        // no value restrictions
                        // no linked objects
                        return;
                    }
                
                default:
                    ctx.Fail<APM_DPM_CatchAll>("* is required to one of 'array;boolean;date;dictionary;integer;name;number;string-text', was " + utval.Type);
                    return;
            }
        }
        
    }

    public static HashSet<string> AllVals = new HashSet<string> { "GTS_Managed", "GTS_Suspect" };
}

